import './App.css';
import { loadFireworksPreset } from 'tsparticles-preset-fireworks';

function Home () {
    return (
        <div>
            <Particles options={particlesConfig} init={particlesInit}/>
        <header className="App-header">
            <h1>HAPPY BIRTHDAY TEEK</h1>
        </header></div>
    );
}
export default Home;
